import React,{Component} from 'react';
import Cardlist from './Cardlist.js';
import Searchbox from './Searchbox.js';
class App extends Component{
	searchChangef=(event)=>{
		console.log(event.target.value);
	}
	render(){
		return(
			<div className='tc'>
				<h1>RoboFriends</h1>
				<Searchbox searchChange={searchChangef}/>
				<Cardlist/>
			</div>
		);
	}

}
export default App;
